(714, 50, 'vibe_course_message', '                            <h2>Congratulations ! Your course has been submitted.</h2>\nThe course is now under evaluation. The instructor will now evaluate the course, considering your performance in the course.\n<ol>\n	<li>Once evaluated you\'ll receive a notification and a message.</li>\n	<li>The message will have your course marks and performance details.</li>\n	<li>You can check your results in the Courses Results section of your profile.</li>\n	<li>If you\'ve gained marks above the passing percentage, you\'ll receive a course completion certificate.</li>\n	<li>If you\'ve excelled in the course you\'ll receive a course badge, which will be showcased in your profile.</li>\n</ol>\nThank you for taking the course. Consider writing a review for this course.                            '),
