(1389, 134, 'vibe_quiz_message', '<h2>Checking Your Answers</h2>\n<ol>\n<li>Depending on how the quiz is configured, you might be allowed to check your answers.</li>\n<li>Once the Quiz has been submitted you&rsquo;ll see a button to check your quiz results. Click on the&nbsp;<strong>Check Quiz Results</strong>&nbsp;button at the top and bottom of the Quiz. This will take you to your profile Course section under the results tab to the Quiz results page.</li>\n<li>If the Instructor has evaluated the Quiz, you&rsquo;ll see the marks besides each question and total marks at the end of the results page.</li>\n<li>Each question is preceded by the word &ldquo;correct&rdquo; or &ldquo;incorrect&rdquo;, and the answer you gave is shown.</li>\n<li>The total quiz score is considered in Final course evaluation as well</li>\n</ol>'),
