(4, 1, '2018-03-22 16:45:42', '2018-03-22 16:45:42', '<strong>Course Instructions</strong>nnPlease enter Course instructions in the Course Status page. To edit this content, simply follow below steps :n<ol>nt<li>Login to WP Admin panel</li>nt<li>Locate and click Pages section</li>nt<li>Search for page Course Status</li>nt<li>Edit the page and change this content</li>nt<li>Update the page.</li>n</ol>', 'Course Status', '', 'publish', 'closed', 'closed', '', 'course-status', '', '', '2018-03-22 16:45:42', '2018-03-22 16:45:42', '', 0, 'http://localhost/formate/course-status/', 0, 'page', '', 0),
