(107, 1, '2014-01-31 15:31:50', '2014-01-31 15:31:50', 'Cupcake ipsum\n\nDolor sit amet chupa chups. Wafer sweet roll jelly-o tootsie roll I love marzipan cake apple pie. Wafer I love I love gingerbread macaroon. Gummies marzipan unerdwear.com fruitcake icing halvah cotton candy sesame snaps caramels. I love I love croissant. Jelly-o oat cake carrot cake.\n\nPowder gingerbread jelly beans liquorice I love pie dragée. Brownie tiramisu pie sesame snaps. Toffee biscuit sesame snaps I love. Sugar plum lemon drops croissant cupcake sweet roll sweet roll lollipop. Gummi bears cake macaroon tiramisu topping. Croissant chupa chups cake icing. Topping sugar plum dragée wafer I love. I love icing chocolate sugar plum lemon drops. Sweet soufflé toffee danish marzipan.\n\n[video width=\"640\" height=\"360\" mp4=\"http://vibethemes.com/envato/wplms/wp-content/uploads/2014/02/big_buck_bunny.mp4\"][/video]\n\nJelly-o bear claw tiramisu ice cream. I love jujubes halvah brownie. Marshmallow bear claw topping caramels halvah lemon drops. Oat cake biscuit marshmallow. Biscuit chocolate cake jelly beans candy canes halvah oat cake apple pie marzipan. Tiramisu fruitcake marshmallow jelly. Soufflé cheesecake tart carrot cake brownie jelly oat cake macaroon. Candy canes oat cake marshmallow pastry chocolate bar. Cookie oat cake candy canes pudding sesame snaps tiramisu sesame snaps. Macaroon muffin bonbon gingerbread.\n\nBear claw bear claw sweet. Pie I love jelly beans toffee apple pie. Jelly soufflé dragée. Danish muffin muffin ice cream. Oat cake I love applicake candy canes caramels pie topping. Biscuit sesame snaps jelly beans soufflé tart candy apple pie jelly beans. Sweet pastry cake. Lemon drops candy canes biscuit I love dessert gummies jujubes apple pie jelly beans. Cookie danish apple pie donut jelly marzipan.\n\nCotton candy sesame snaps cheesecake fruitcake danish toffee bear claw. Candy canes soufflé I love. Sesame snaps gummies lollipop halvah jelly-o lollipop liquorice danish marshmallow. Candy canes muffin jelly beans powder jelly beans I love sweet roll powder macaroon. Dessert powder ice cream liquorice. Chocolate cake bear claw candy sweet sweet roll chocolate cake carrot cake tart I love. Brownie unerdwear.com sesame snaps lemon drops icing.\n<!--nextpage-->\nChupa chups chocolate liquorice carrot cake soufflé. Biscuit croissant liquorice cupcake gingerbread croissant pastry tart. Pastry danish lemon drops I love candy marshmallow I love jujubes. I love gummi bears lemon drops soufflé marzipan oat cake. Gingerbread jelly beans fruitcake unerdwear.com apple pie carrot cake caramels tootsie roll. Marshmallow I love applicake cookie. Pie donut I love powder dragée jelly oat cake marzipan. Cheesecake croissant jelly-o powder sesame snaps croissant biscuit pastry danish.\n\n&nbsp;\n<h3>1914 translation by H. Rackham</h3>\n\"But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful. Nor again is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but because occasionally circumstances occur in which toil and pain can procure him some great pleasure. To take a trivial example, which of us ever undertakes laborious physical exercise, except to obtain some advantage from it? But who has any right to find fault with a man who chooses to enjoy a pleasure that has no annoying consequences, or one who avoids a pain that produces no resultant pleasure?\"\n<h3>Section 1.10.33 of \"de Finibus Bonorum et Malorum\", written by Cicero in 45 BC</h3>\n\"At vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis praesentium voluptatum deleniti atque corrupti quos dolores et quas molestias excepturi sint occaecati cupiditate non provident, similique sunt in culpa qui officia deserunt mollitia animi, id est laborum et dolorum fuga. Et harum quidem rerum facilis est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio cumque nihil impedit quo minus id quod maxime placeat facere possimus, omnis voluptas assumenda est, omnis dolor repellendus. Temporibus autem quibusdam et aut officiis debitis aut rerum necessitatibus saepe eveniet ut et voluptates repudiandae sint et molestiae non recusandae. Itaque earum rerum hic tenetur a sapiente delectus, ut aut reiciendis voluptatibus maiores alias consequatur aut perferendis doloribus asperiores repellat.\"\n<!--nextpage-->\n<h3>1914 translation by H. Rackham</h3>\n\"On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, so blinded by desire, that they cannot foresee the pain and trouble that are bound to ensue; and equal blame belongs to those who fail in their duty through weakness of will, which is the same as saying through shrinking from toil and pain. These cases are perfectly simple and easy to distinguish. In a free hour, when our power of choice is untrammelled and when nothing prevents our being able to do what we like best, every pleasure is to be welcomed and every pain avoided. But in certain circumstances and owing to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated and annoyances accepted. The wise man therefore always holds in these matters to this principle of selection: he rejects pleasures to secure other greater pleasures, or else he endures pains to avoid worse pains.\"', 'Introduction to Social Media', '', 'publish', 'open', 'closed', '', 'introduction-to-social-media', '', '', '2014-01-31 15:31:50', '2014-01-31 15:31:50', '', 0, 'http://vibethemes.com/envato/wplms/?post_type=unit&amp;p=213', 0, 'unit', '', 0),
