(140, 1, '2014-02-01 12:38:34', '2014-02-01 12:38:34', '<h1>Instructions for Taking the Quiz</h1>\n<h2>Logging In</h2>\nWhen you access a Quiz page, you might first be prompted to log in to the site. You can login using the controls in the top right section in the header of the site.\n<h2>Taking the Quiz</h2>\n<ol>\n	<li>Select an answer for every question. Unanswered questions will be scored as incorrect.</li>\n	<li>There are three possible question types:\n<ul>\n	<li><strong>Multiple Choice</strong>: click the radio button to indicate your choice. Currently, only one answer can be selected for a multiple choice question. One Answer can be saved only once.</li>\n	<li><strong>True/False</strong>: click the radio button to indicate your choice. One Answer can be saved only once.</li>\n	<li><strong>One Word</strong>: Enter one word answer for the questions asked. One Answer can be saved only once.</li>\n	<li><strong>Essay Type</strong>: Enter one word answer for the questions asked</li>\n	<li>If you use a wheel button mouse, take care not to accidently change your answers. Sometimes scrolling the wheel will rotate through the answers in a selection list, when you might have meant simply to scroll farther down in the quiz window.</li>\n</ul>\n</li>\n	<li>Click on the <strong>Save Answer</strong> button at the bottom of the question save your answer for grading.</li>\n	<li>Click on the <strong>Submit</strong> button at the top and bottom of the page to have your answers graded.</li>\n	<li>The Quiz will then be evaluated by the Instructor of the course. Once evaluated you\'ll be notified of the results from notifications and a message with your score will be sent to you.</li>\n	<li>The quiz results will be available in your Profile Courses -&gt; Results section.</li>\n	<li>If you want to try to get a better score, You need to contact your Instructor to reset the quiz for you.</li>\n</ol>\n<h2>Checking Your Answers</h2>\n<ol>\n	<li>Depending on how the quiz is configured, you might be allowed to check your answers.</li>\n	<li>Once the Quiz has been submitted you\'ll see a button to check your quiz results. Click on the <strong>Check Quiz Results</strong> button at the top and bottom of the Quiz. This will take you to your profile Course section under the results tab to the Quiz results page.</li>\n	<li>If the Instructor has evaluated the Quiz, you\'ll see the marks besides each question and total marks at the end of the results page.</li>\n	<li>Each question is preceded by the word \"correct\" or \"incorrect\", and the answer you gave is shown.</li>\n	<li>The total quiz score is considered in Final course evaluation as well.</li>\n</ol>', 'Final Quiz for the course', '', 'publish', 'closed', 'closed', '', 'quiz2-quiz', '', '', '2014-02-01 12:38:34', '2014-02-01 12:38:34', '', 0, 'http://vibethemes.com/envato/wplms/?post_type=quiz&amp;p=1134', 0, 'quiz', '', 0),
